import React, {Component} from 'react';
import {Container,Button} from 'react-bootstrap'

import './landingPage.css';
import AwesomeSlider from 'react-awesome-slider';
import AwsSliderStyles from 'react-awesome-slider/src/styles';
import SocialMedia from '../SocialMedia/SocialMedia';


class LandingPage extends Component {
    render(){
        return (
            <div className = 'Carousel'>
  <AwesomeSlider cssModule={AwsSliderStyles}>
    <div data-src="https://www.thespruce.com/thmb/0-1AhGYlCEGMwWayMh_G0ppyKiI=/5156x2900/smart/filters:no_upscale()/PAINT_COSMICSAPPHIRE_V2-5e2176321d74492bb883cbec4ceb5abd.jpg" />
    <div data-src="https://www.worx.com/media/wysiwyg/category-pages/lawn-mowers/category_lawn-mowers_mobile.jpg" />
    <div data-src="/path/to/image-2.jpg" />
  </AwesomeSlider>
  <Button variant="outline-secondary">Secondary</Button>{' '}
);
<div className = 'socialMedia'>
  <Container>
    <SocialMedia/>
  </Container>
</div>
</div>    
        )
    }
}

export default LandingPage;
